import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link, useParams } from 'react-router-dom';
import Header from '../components/Header';
import './MyReservations.css';

function MyReservations() {
  const { user_id } = useParams();
  const [reservations, setReservations] = useState([]);

  useEffect(() => {
    const fetchReservations = async () => {
      try {
        const response = await axios.get(`/dailband/user/${user_id}/reservations`);
        console.log('User reservations response:', response.data);
        setReservations(response.data.reservations);
      } catch (error) {
        console.error('Failed to fetch user reservations:', error);
      }
    };

    fetchReservations();
  }, [user_id]);

  const handleDeleteReservation = async (reservationId) => {
    try {
      await axios.delete(`/dailband/user/${user_id}/reservations/${reservationId}`);
      setReservations(reservations.filter(reservation => reservation.reservation_id !== reservationId));
    } catch (error) {
      console.error('Failed to delete reservation:', error);
    }
  };

  return (
    <div className="MyReservations">
      <Header />
      <div className="MyReservations-container">
        <div className="Sidebar">
          <div className="Profile-picture">
            <img src="/path/to/default-profile.png" alt="프로필 사진" />
          </div>
          <h2>사용자 닉네임</h2>
          <Link to={`/profile/edit/${user_id}`}>프로필 수정</Link>
          <Link to={`/scrap/${user_id}`}>스크랩</Link>
          <Link to={`/myposts/${user_id}`}>내가 쓴 글</Link>
          <Link to={`/myperformances/${user_id}`}>내가 작성한 공연 조회</Link>
          <Link to={`/myreservations/${user_id}`} className="active">공연 예약</Link>
        </div>
        <div className="Content">
          <h2>공연 예약</h2>
          {reservations.length === 0 ? (
            <p>예약한 공연이 없습니다.</p>
          ) : (
            <ul className="ReservationsList">
              {reservations.map((reservation) => (
                <li key={reservation.reservation_id} className="ReservationItem">
                  <div>
                    <Link to={`/performance/${reservation.performance_id}`}>
                      <h4>{reservation.title}</h4>
                      <p>{reservation.content}</p>
                    </Link>
                    <p>예약 날짜: {new Date(reservation.date).toLocaleDateString()}</p>
                    <p>장소: {reservation.venue}</p>
                  </div>
                  <button onClick={() => handleDeleteReservation(reservation.reservation_id)}>삭제</button>
                </li>
              ))}
            </ul>
          )}
        </div>
      </div>
    </div>
  );
}

export default MyReservations;
